/**
 * Returns the last element of an iterable.
 * @param {Iterable} iterable - The input iterable.
 * @returns {any} The last element of the iterable, or undefined if the iterable is empty.
 *
 * @example
 * const numbers = [1, 2, 3, 4, 5];
 * console.log(iLast(numbers)); // 5
 */
export function iLast(iterable: Iterable<any>): any;
